import React from "react";
import {
  Dialog,
  DialogContent,
  DialogTitle,
  Typography,
  DialogActions,
  Button,
} from "@material-ui/core";
import { useLocation } from "react-router-dom";

//form
import InputTextField from "./Form/InputTextField";

function DialogEditUsers(props) {
  let location = useLocation();
  let params = new URLSearchParams(props);
  console.log("ini props dialog =>", props, params.get("users"));

  return (
    <Dialog open={true} aria-labelledby="form-dialog-edit-users">
      <DialogTitle>
        <Typography> Edit Data</Typography>
      </DialogTitle>
      <DialogContent>
        <InputTextField />
      </DialogContent>
      <DialogActions>
        <Button color="primary">Cancel</Button>
        <Button color="primary">Subscribe</Button>
      </DialogActions>
    </Dialog>
  );
}

export default DialogEditUsers;
